import React from "react";
import { Edit, LogOut, Mail, Phone, MapPin, Instagram, Facebook, Twitter, Lock, CreditCard, Heart, Truck, Settings, Key } from "lucide-react";
import { useNavigate } from "react-router-dom";

const Profile = () => {
        const user = {
                name: "Sophia Carter",
                email: "sophia@example.com",
                phone: "+1 (555) 123-4567",
                location: "New York, USA",
                avatar: "https://via.placeholder.com/150",
        };

        const navigate = useNavigate.navigate();

        const handleLogout = () => {
                localStorage.removeItem("userToken");
                window.dispatchEvent(new Event("storage")); // Update authentication state
                navigate("/");
        };

        return (
                <div className="min-h-screen bg-gradient-to-br from-gray-100 to-gray-200 flex justify-center py-10 px-4">
                        <div className="w-full max-w-4xl bg-white rounded-2xl shadow-lg p-8 border border-gray-200 relative overflow-hidden">
                                {/* Cover Image */}
                                <div className="absolute top-0 left-0 w-full h-32 bg-gradient-to-r from-indigo-500 to-purple-500 rounded-t-2xl"></div>

                                {/* Profile Header */}
                                <div className="relative flex items-center space-x-6 border-b pb-6 pt-10">
                                        <img
                                                src={user.avatar}
                                                alt="User Avatar"
                                                className="w-24 h-24 rounded-full border-4 border-white shadow-md"
                                        />
                                        <div>
                                                <h1 className="text-2xl font-bold text-gray-800">{user.name}</h1>
                                                <p className="text-gray-500 text-sm">Jewelry Enthusiast ðŸ’Ž | Designer âœ¨</p>
                                        </div>
                                        <button className="ml-auto flex items-center bg-gray-900 text-white px-4 py-2 rounded-lg shadow-md hover:bg-gray-700 transition-all duration-300">
                                                <Edit className="w-4 h-4 mr-2" /> Edit Profile
                                        </button>
                                </div>

                                {/* User Details */}
                                <div className="mt-6 grid grid-cols-2 gap-6 border-b pb-6 text-gray-700">
                                        {[['Email', user.email, Mail], ['Phone', user.phone, Phone], ['Location', user.location, MapPin]].map(([label, value, Icon], index) => (
                                                <div key={index} className="flex items-center space-x-3">
                                                        <Icon className="w-5 h-5 text-gray-500" />
                                                        <p>{value}</p>
                                                </div>
                                        ))}
                                </div>

                                {/* Quick Links */}
                                <div className="mt-6 grid grid-cols-2 gap-6">
                                        {[['My Orders', Truck], ['Wishlist', Heart], ['Payment Methods', CreditCard], ['Saved Addresses', Lock]].map(([label, Icon], index) => (
                                                <div key={index} className="flex items-center space-x-3 bg-gray-100 p-4 rounded-lg shadow-sm hover:bg-gray-200 transition-all duration-300 cursor-pointer">
                                                        <Icon className="w-5 h-5 text-gray-600" />
                                                        <p className="text-gray-700 font-medium">{label}</p>
                                                </div>
                                        ))}
                                </div>

                                {/* Recent Activity */}
                                <div className="mt-6 border-t pt-6">
                                        <h3 className="text-xl font-semibold text-gray-800 mb-4">Recent Activity</h3>
                                        {[['Order #12345 - Delivered on Jan 10, 2025', 'You purchased a Diamond Necklace ðŸ’Ž'], ['Wishlist Updated - Jan 8, 2025', 'You added a Gold Bracelet to your Wishlist âœ¨']].map(([title, desc], index) => (
                                                <div key={index} className="bg-gray-100 p-4 rounded-lg shadow-sm mt-3 hover:bg-gray-200 transition-all duration-300">
                                                        <p className="text-gray-700 font-medium">{title}</p>
                                                        <p className="text-gray-500 text-sm">{desc}</p>
                                                </div>
                                        ))}
                                </div>

                                {/* Security & Settings */}
                                <div className="mt-6 border-t pt-6">
                                        <h3 className="text-xl font-semibold text-gray-800 mb-4">Security & Settings</h3>
                                        <div className="grid grid-cols-2 gap-6">
                                                {[['Change Password', Key], ['Account Settings', Settings]].map(([label, Icon], index) => (
                                                        <div key={index} className="flex items-center space-x-3 bg-gray-100 p-4 rounded-lg shadow-sm hover:bg-gray-200 transition-all duration-300 cursor-pointer">
                                                                <Icon className="w-5 h-5 text-gray-600" />
                                                                <p className="text-gray-700 font-medium">{label}</p>
                                                        </div>
                                                ))}
                                        </div>
                                </div>

                                {/* Social Media Links */}
                                <div className="mt-6 flex space-x-4 justify-center">
                                        {[['Facebook', Facebook, 'text-blue-600'], ['Instagram', Instagram, 'text-pink-600'], ['Twitter', Twitter, 'text-blue-400']].map(([label, Icon, color], index) => (
                                                <a key={index} href="#" className={`${color} hover:opacity-75 transition-all duration-300`}>
                                                        <Icon className="w-6 h-6" />
                                                </a>
                                        ))}
                                </div>

                                {/* Logout Button */}
                                <div className="mt-6 flex justify-center">
                                <button onClick={handleLogout} className="px-4 py-2 bg-red-600 text-white rounded-md">
                                                                Logout
                                                        </button>
                                </div>
                        </div>
                </div>
        );
};

export default Profile;
